import{_ as s,c as a,a8 as t,o as i}from"./chunks/framework.BDnHobkS.js";const u=JSON.parse('{"title":"PX4 콘솔/쉘","description":"","frontmatter":{},"headers":[],"relativePath":"ko/debug/consoles.md","filePath":"ko/debug/consoles.md"}'),o={name:"ko/debug/consoles.md"};function l(n,e,h,p,d,c){return i(),a("div",null,e[0]||(e[0]=[t(`<h1 id="px4-콘솔-쉘" tabindex="-1">PX4 콘솔/쉘 <a class="header-anchor" href="#px4-콘솔-쉘" aria-label="Permalink to &quot;PX4 콘솔/쉘&quot;">​</a></h1><p>PX4 enables terminal access to the system through the <a href="./../debug/mavlink_shell.html">MAVLink Shell</a> and the <a href="./../debug/system_console.html">System Console</a>.</p><p>이 페이지에서는 콘솔과 쉘 사용 방법과 주요 차이점을 설명합니다.</p><p><a id="console_vs_shell"></a></p><h2 id="시스템-콘솔과-셸의-차이점" tabindex="-1">시스템 콘솔과 셸의 차이점 <a class="header-anchor" href="#시스템-콘솔과-셸의-차이점" aria-label="Permalink to &quot;시스템 콘솔과 셸의 차이점&quot;">​</a></h2><p>The PX4 <em>System Console</em> provides low-level access to the system, debug output and analysis of the system boot process.</p><p>There is just one <em>System Console</em>, which runs on one specific UART (the debug port, as configured in NuttX), and is commonly attached to a computer via an FTDI cable (or some other debug adapter like a <a href="https://kb.zubax.com/display/MAINKB/Dronecode+Probe+documentation" target="_blank" rel="noreferrer">Dronecode probe</a>).</p><ul><li>Used for <em>low-level debugging/development</em>: bootup, NuttX, startup scripts, board bringup, development on central parts of PX4 (e.g. uORB).</li><li>특히, 모든 부팅 출력(부팅 시 자동으로 시작되는 응용 프로그램에 대한 정보 포함)이 인쇄되는 유일한 장소입니다.</li></ul><p>셸은 시스템에 대한 상위 수준의 접급을 제공합니다.</p><ul><li>기본 모듈 테스트와 명령어를 실행할 수 있습니다.</li><li>Only <em>directly</em> display the output of modules you start.</li><li>Cannot <em>directly</em> display the output of tasks running on the work queue.</li><li>시스템이 시작되지 않으면(아직 실행되지 않기 때문에) 문제를 디버그할 수 없습니다.</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The <code>dmesg</code> command is now available through the shell on some boards, enabling much lower level debugging than previously possible. For example, with <code>dmesg -f &amp;</code> you also see the output of background tasks.</p></div><p>전용 UART에서 실행되거나, MAVLink로 실행되는 여러 셸이 있을 수 있습니다. Since MAVLink provides more flexibility, currently only the <a href="./../debug/mavlink_shell.html">MAVLink Shell</a> is used.</p><p>The <a href="./../debug/system_console.html">System Console</a> is essential when the system does not boot (it displays the system boot log when power-cycling the board). The <a href="./../debug/mavlink_shell.html">MAVLink Shell</a> is much easier to setup, and so is more generally recommended for most debugging.</p><p><a id="using_the_console"></a></p><h2 id="콘솔-쉘-사용" tabindex="-1">콘솔/쉘 사용 <a class="header-anchor" href="#콘솔-쉘-사용" aria-label="Permalink to &quot;콘솔/쉘 사용&quot;">​</a></h2><p>The MAVLink shell/console and the <a href="./../debug/system_console.html">System Console</a> are used in much the same way.</p><p>For example, type <code>ls</code> to view the local file system, <code>free</code> to see the remaining free RAM, <code>dmesg</code> to look at boot output.</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">nsh</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">&gt; </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">ls</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">nsh</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">&gt; </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">free</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">nsh</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">&gt; </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">dmesg</span></span></code></pre></div><p>Below are a couple of commands which can be used in the <a href="https://cwiki.apache.org/confluence/pages/viewpage.action?pageId=139629410" target="_blank" rel="noreferrer">NuttShell</a> to get insights of the system.</p><p>This NSH command provides the remaining free memory:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">free</span></span></code></pre></div><p>The top command shows the stack usage per application:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">top</span></span></code></pre></div><p>Note that stack usage is calculated with stack coloring and is the maximum since the start of the task (not the current usage).</p><p>To see what is running in the work queues and at what rate, use:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">work_queue</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> status</span></span></code></pre></div><p>To debug uORB topics:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">uorb</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> top</span></span></code></pre></div><p>To inspect a specific uORB topic:</p><div class="language-sh vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">listener</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> &lt;</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">topic_nam</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">e</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">&gt;</span></span></code></pre></div><p>Many other system commands and modules are listed in the <a href="./../modules/modules_main.html">Modules and Command Reference</a> (e.g. <code>top</code>, <code>listener</code>, etc.).</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Some commands may be disabled on some boards (i.e. the some modules are not included in firmware for boards with RAM or FLASH constraints). In this case you will see the response: <code>command not found</code></p></div>`,32)]))}const m=s(o,[["render",l]]);export{u as __pageData,m as default};
